// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts-upgradeable/token/ERC20/ERC20Upgradeable.sol";
import "@openzeppelin/contracts-upgradeable/token/ERC20/extensions/ERC20CappedUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
//import "@openzeppelin/contracts/utils/cryptography/MerkleProof.sol";

/// @custom:security-contact founders@superfast.cards
contract Petrol is Initializable, ERC20CappedUpgradeable, OwnableUpgradeable {

    bytes32 public merkleRoot;
    uint256 private MAX_TREASURY;
    uint256 private MAX_NFT_SALES;
    uint256 private MAX_GAME;
    uint256 private MAX_SALE;
    uint256 private MAX_AIRDROP;

    mapping(address=>bool) private claimed;

    uint256 public claimPeriodEnds;

    function initialize() initializer public {
        __ERC20_init("Petrol", "PETROL");
        __ERC20Capped_init(500000000 * 10 ** decimals());
        __Ownable_init();
        MAX_TREASURY = (249500000+165000000) * 10 ** decimals();
        MAX_NFT_SALES = 100000000 * 10 ** decimals();
        MAX_GAME = 100000000 * 10 ** decimals();
        MAX_SALE = 100000000 * 10 ** decimals();
        MAX_AIRDROP = 50000000 * 10 ** decimals();
    }

    function mint(address to, uint256 amount) public onlyOwner {
        _mint(to, amount);
    }

    function transferTokensToUser(address adr, uint256 amount) public {
        require(msg.sender == 0x314ef52544C1d16A327dd631d2f9Be6F85d5398A || msg.sender == 0xb25801B5Ab763a001E0d06b4CC7934144EFCe8CB, "You are not authorized.");
        _transfer(address(this), adr, amount);
    }

    function claimTokensForUser(address adr, uint256 amount) public onlyOwner {
        require(!claimed[adr], "Tokens already claimed.");
        claimed[adr] = true;

        _transfer(address(this), adr, amount);
    }

    function claimTokensForUsers(address[] memory adr, uint256[] memory amount) public onlyOwner {
        for (uint i=0; i<adr.length; i++) {
            if (claimed[adr[i]]) {

            }
            else {
                claimed[adr[i]] = true;
                _transfer(address(this), adr[i], amount[i]);
            }
        }
    }

}

